package com.tnif.daytwo;

public class ForEachloop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a[]= {10,20,30,40,50};
		for(int i:a)
		{
			System.out.println(i);
		}
		char c[]= {'A','B','C','D','E'};
		for(char i:c)
		{
			System.out.println(i);
		}
		String h[]= {"java","Application"};
		for(String i:h)
		{
			System.out.println(i);
		}
		

	}

}
